export const apiOptions: RequestInit = {
  method: 'GET',
  headers: {
    'X-RapidAPI-Key': '13f7b1cd2dmsh805857b48dc7bbep17a950jsn7532e4c61cb4',
    'X-RapidAPI-Host': 'wft-geo-db.p.rapidapi.com',
  },
};
import axios from 'axios';

const api = axios.create({ baseURL: process.env.GEO_APP_API_URL });

api.interceptors.request.use(config => {
  config.url =
    config.url + '&units=metric' + '&appid=' + process.env.WEATHER_APP_API_KEY;
  return config;
});

export default api;
